import Player1 from "./player1.js";
import Player2 from "./player2.js";


function App() {
  return (
    <div className="container px-lg-5">
      <div class="row mx-lg-n5">
        <div class="col py-3 px-lg-5 border bg-light">
          <Player1 />
        </div>
        <div class="col py-3 px-lg-5 border bg-light">
          <Player2 />
        </div>
      </div>
    </div>
  );
}

export default App;
